import {Injectable} from '@angular/core';
import {BehaviorSubject, Observable} from 'rxjs';

@Injectable({
    providedIn: 'root'
})
export class LayoutService {
    private sidenavOpened = new BehaviorSubject<boolean>(false);
    private _$sidenavOpened = this.sidenavOpened.asObservable();

    get $sidenavOpened(): Observable<boolean> {
        return this._$sidenavOpened;
    }

    constructor() {
    }

    toggleSidenav(value?: boolean): void {
        if (typeof value === 'boolean') {
            this.sidenavOpened.next(value);
        } else {
            this.sidenavOpened.next(!this.sidenavOpened.value);
        }
    }
}

import {Injectable} from '@angular/core';
import {NavigationItem} from './models/navigation-item';

@Injectable({
    providedIn: 'root'
})
export class NavigationService {

    private _navigation: NavigationItem[];

    constructor() {
    }

    get navigation(): NavigationItem[] {
        return this._navigation;
    }

    set navigation(value: NavigationItem[]) {
        this._navigation = value;
    }

    getNavigationItem(id: string, navigation?: NavigationItem[]): NavigationItem {

        if (!navigation) {
            navigation = this.navigation;
        }

        for (const item of navigation) {
            if (item.id === id) {
                return item;
            }

            if (item.children) {
                const childItem = this.getNavigationItem(id, item.children);

                if (childItem) {
                    return childItem;
                }
            }
        }
    }

    addNavigationItem(parent: NavigationItem, item: NavigationItem): void {
        if (!parent.children) {
            parent.children = [];
        }
        parent.children.push(item);
    }
}

